import React, { Component } from 'react';
import Project from './Project';
import Grid from '@material-ui/core/Grid';
import Container from '@material-ui/core/Container';


class App extends Component {
  state = {
    projects: [
      {
        image: "",
        name: "Guil",
        tools: 0,
        projectLink: "",
        codeLink: "",
        id: 1,
        key: 1,
        index: ""
      },
      {
        image: "",
        name: "Treasure",
        tools: 0,
        projectLink: "",
        codeLink: "",
        id: 2,
        key: 2,
        index: ""
      },
      {
        image: "",
        name: "Ashley",
        tools: 0,
        projectLink: "",
        codeLink: "",
        id: 3,
        key: 3,
        index: ""
      },
      {
        image: "",
        name: "James",
        tools: 0,
        projectLink: "",
        codeLink: "",
        id: 4,
        key: 4,
        index: ""
      }
    ]

  };


  render() {
    return (
      <Container maxWidth="md">
        <Grid container spacing={4}>

            {this.state.projects.map( (project, index) =>
            <Project 
              image={project.image}
              name={project.name}
              tools={project.tools}
              projectLink={project.projectLink}
              codeLink={project.codeLink}
              id={project.id}
              key={project.id.toString()} 
              index={index}           
            />
          )}

        </Grid>
      </Container>
    );
  } 
}

export default App;
